import { Component } from "react";

class Contact extends Component {
  constructor(props) {
    super(props);
    this.state = {
      phone: "064-760-1980",
      email: "nutthaphong_w@cmu.ac.th",
      social_medie: ["facebook", "twitter", "git-hub"],
    };
  }
  render() {
    return (
      <div className="Contact-card">
        <div className="Form-message">
            <form>
                <label for="username">Username :</label>
                <input type="text" id="username" name="username" placeholder="username" required></input>
                <label for="password">Password :</label>
                <input type="text" id="password" name="password" placeholder="password" required></input>
            </form>
        </div>
        <div className="Contact-list">
          <h1>Contact</h1>
          <ul>
            <p>Direct contact</p>
            <li>Phone {this.state.phone}</li>
            <li>Email {this.state.email}</li>
            <span>My social-medie list</span>
            {this.state.social_medie.map((val) => {
              return <li>{val}</li>;
            })}
          </ul>
        </div>
      </div>
    );
  }
}
export default Contact;
